import React from 'react';

function tipomercados (props){
    return (
        <div className="tipomercados">
            <div className="logoTipoMercados">
                <img className='imagenLogo' src={props.img} alt="imagen" />
            </div>
        </div>
    )
}

export default tipomercados;
